  const { width, height } = useWindowSize();
  console.log(width, height);

  return (
    <ReactSketchCanvas
      id={"rsc"}
      width={"500px"}
      height={"500px"}
      strokeWidth={15}
      eraserWidth={15}
      strokeColor={"blue"}
      canvasColor={"white"}
    />
  );
};

export default App;
